import React, { useState, useEffect } from "react";

export default function AssessmentPreview({ assessment }) {
  const [answers, setAnswers] = useState(() => {
    const saved = localStorage.getItem("assessmentAnswers");
    return saved ? JSON.parse(saved) : {};
  });

  useEffect(() => {
    localStorage.setItem("assessmentAnswers", JSON.stringify(answers));
  }, [answers]);

  const handleChange = (qid, value) => {
    setAnswers({ ...answers, [qid]: value });
  };

  const validate = (q) => {
    const val = answers[q.id];
    if (q.required && !val) return "This field is required.";
    if (q.type === "numeric" && (val < q.range.min || val > q.range.max))
      return `Enter value between ${q.range.min}-${q.range.max}`;
    if (q.type === "long" && val?.length > q.maxLength)
      return `Max length ${q.maxLength}`;
    return null;
  };

  return (
    <div>
      <h2 className="text-xl font-bold mb-3">ðŸ“‹ Live Preview</h2>
      <p className="text-gray-600 mb-4">{assessment.title}</p>

      {assessment.sections.map((s) => (
        <div key={s.id} className="mb-6">
          <h3 className="font-semibold mb-2">{s.name}</h3>

          {s.questions.map((q) => {
            const show =
              !q.condition.dependsOn ||
              answers[q.condition.dependsOn] === q.condition.value;

            if (!show) return null;

            const error = validate(q);

            return (
              <div key={q.id} className="mb-4">
                <label className="block font-medium mb-1">
                  {q.label} {q.required && <span className="text-red-500">*</span>}
                </label>

                {q.type === "short" && (
                  <input
                    type="text"
                    value={answers[q.id] || ""}
                    onChange={(e) => handleChange(q.id, e.target.value)}
                    className="border p-2 rounded w-full"
                  />
                )}

                {q.type === "long" && (
                  <textarea
                    value={answers[q.id] || ""}
                    onChange={(e) => handleChange(q.id, e.target.value)}
                    className="border p-2 rounded w-full"
                    rows={3}
                  ></textarea>
                )}

                {q.type === "numeric" && (
                  <input
                    type="number"
                    value={answers[q.id] || ""}
                    onChange={(e) =>
                      handleChange(q.id, e.target.valueAsNumber)
                    }
                    className="border p-2 rounded w-full"
                  />
                )}

                {q.type === "file" && (
                  <input
                    type="file"
                    onChange={(e) =>
                      handleChange(q.id, e.target.files?.[0]?.name || "")
                    }
                    className="border p-2 rounded w-full"
                  />
                )}

                {q.type === "single-choice" &&
                  q.options.map((opt) => (
                    <div key={opt}>
                      <input
                        type="radio"
                        name={q.id}
                        checked={answers[q.id] === opt}
                        onChange={() => handleChange(q.id, opt)}
                      />{" "}
                      {opt}
                    </div>
                  ))}

                {q.type === "multi-choice" &&
                  q.options.map((opt) => (
                    <div key={opt}>
                      <input
                        type="checkbox"
                        checked={answers[q.id]?.includes(opt)}
                        onChange={(e) => {
                          const prev = answers[q.id] || [];
                          handleChange(
                            q.id,
                            e.target.checked
                              ? [...prev, opt]
                              : prev.filter((x) => x !== opt)
                          );
                        }}
                      />{" "}
                      {opt}
                    </div>
                  ))}

                {error && <div className="text-red-500 text-sm">{error}</div>}
              </div>
            );
          })}
        </div>
      ))}
    </div>
  );
}
